import React from "react"

const MessagesWithUser = (props) =>{
    const date = props.DialogsMessagesTemp.addedAt.items[0].addedA.tsplit("T")[0]
    const time = props.DialogsMessagesTemp.addedAt.split("T")[1].split(".")[0]
    return <div>
        {props.DialogsMessagesTemp.items[0].body}

    {date} {time}
    </div>
}
export default MessagesWithUser
